B.GJ=new A.aA(B.rL,["HapTID","Haptic Technology for Improved Dexterity","images/haptid.png","GitHub","https://github.com/louis-badr/HapTID","Haptic technologies are increasingly used in rehabilitation settings. Stroke victims suffer from severe motor and sensory deficits that handicap their daily lives. HapTID's first purpose is to study and improve dexterity in healthy subjects. It will then be used as a toolkit by researchers and medical professionals to extend the study to post-stroke neuro-rehabilitation. I was able to carry out the literature review, design and fabrication of the system and a study at the Integrative Neuroscience & Cognition Center under the supervision of Lucile Dupin and in collaboration with the Paris Institute of Psychiatry and Neuroscience."],t.w)
B.GK=new A.aA(B.rL,["AugmenTip","Fingertip haptic feedback on a budget","images/augmentip.png","Cables.gl","https://cables.gl/view/63a40d00198bbcd53ea66a0c"," Hands are our main means of physical interaction with our environment, hence the desire to reproduce these sensations artificially and to do without traditional peripherals such as controllers for virtual experiences. In recent years, a number of DIY and open-source projects have emerged that have made haptics more attractive and accessible. One of the best-known projects is LucidGloves, an exoskeleton for the hand that provides kinaesthetic grasping sensations. AugmenTip aims to add cutaneous feedback (contact, pressure and vibration) to all five fingertips within the same DIY and open source framework. This project was carried out at the DeVinci Innovation Center as part of the Creative Technology Engineering master's program."],t.w)
B.rJ={title:0,subtitle:1,linkLabel:2,asset:3,link:4,description:5}
B.Hs=new A.aA(B.rJ,["Smart Lock","Smarter lab equipment access control","GitHub","images/smartlock.png","https://github.com/louis-badr/SmartLock","Smart Lock is a device I designed to regulate access to equipment for the DeVinci Innovation Center labs and student clubs. The cabinets contain consumables that need to be restocked regularly, as well as equipment that is sometimes sensitive, expensive or hazardous. With the multiplication of projects, it has become necessary to be able to know who has accessed a cabinet, to restrict access to certain cabinets but also to simplify the ordering process for consumables. Smart Lock attaches to a cabinet and features a touch screen, RFID reader and electric lock to enable students and staff to use the equipment autonomously with their university badges. This project, which is now used on a daily basis, helped me get started in electronics and improve my product design skills."],t.w)
B.Hr=new A.aA(B.rJ,["DECIDE","Kickstarter product design project","Kickstarter","images/decide.png","https://www.kickstarter.com/projects/decide/quickstarter-decide","In the first year of the Creative Technology master's program, students have to create a product from scratch, guided by an industrial designer, and launch a Kickstarter campaign. The aim of this 'Quickstarter' format is to use a single material, a single manufacturing process and a single factory to create a project in just a few months and raise at least \u20ac1,000. With Thomas Juldo and Tristan Journel we created and launched DECIDE, a 12-sided origami-inspired dice, covered with whiteboard material to make decision making fun, stimulate creativity and create original games."],t.w)
B.HV={title:0,subtitle:1,description:2}
B.Hu=new A.aA(B.HV,["DVIC Signet Ring","Making a graduation ring from scratch for the DVIC students","To celebrate the graduation of the Creative Technology program, I was given the challenge of creating a signet ring to give to the students, reflecting their projects and their pride in belonging to this community. For the first edition, I designed the ring and introduced a manufacturing process based on resin-wax 3D printing and vacuum metal casting to create aesthetic and durable silver rings. The design evokes the themes of the three DVIC groups and projects: technology, nature and humans."],t.w)
